import React from 'react';

function Food({ name, picture }) {
  return <div>
    <h2>I like {name}</h2>
    <img src={picture} />
  </div>
}

const foodILike = [
  {
    name: "kimchi",
    image: "a"
  },
  {
    name: "ramen",
    image: "b"
  },
  {
    name: "samgiopsal",
    image: "c"
  },
  {
    name: "chukumi",
    image: "d"
  }
]

function renderFood(dish) {
  console.log(dish);
  return <Food name={dish.name} picture={dish.image} />
}

function App() {
  return (
    <div>{foodILike.map(renderFood)}</div>
  );
}

export default App;
